// HomePage.js
import React from 'react';

import EpicButton from '../StyledComponentsApp/EpicButton';

const HomePage = () => {
    return (
        <div>
            <EpicButton registration>Регистрация</EpicButton>
            <EpicButton>Войти</EpicButton>
        </div>
    );
};

export default HomePage;
